import { NavLink } from 'react-router-dom';

const Navigation = () => {
    return (
        <div className="navigation">
            <ul>
                <NavLink to="/" exact className="hover" activeClassName="nav-active" >
                    <li>accueil</li>

                </NavLink>
            </ul>

        </div>
    );
};

export default Navigation;
